import React from 'react'
import {TodoItem} from "./";

const Todos = (props) => {
  
  return (
    <div className='container'> 
      <h3>Todods List</h3>
      <TodoItem todo ={props.todo[0]}/>
    </div>
  )
}

export default Todos
